  state = {
    tasks: [
      {id: 0, status: "to do", task:"task by state"},
      {id: 1, status: "done", task:"task by state"},
    ]
  }



  render(){



    return(
      <div className='App'>
        <List
          tasks = {this.state.tasks}
          Event = {addEventListener('click', alert("test"))}
        />
      </div>
    )
  }
}

export default App;
